import React, { useState, useEffect } from "react";
import { useStyles } from "./style";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import Typography from "@material-ui/core/Typography";
import Grid from "@material-ui/core/Grid";
import AccountCircleIcon from "@material-ui/icons/AccountCircle";

const TopBar = () => {
  const classes = useStyles();

  // const headData = ["Lịch Chiếu", "Cụm Rạp", "Tin Tức", "Ứng Dụng"];
  const headData = [
    {
      name: "Ăn uống",
      id: "anUong",
    },
    {
      name: "Nhà hàng uy tín",
      id: "nhaHangUyTin",
    },
    {
      name: "Ưu đãi hot",
      id: "uuDaiHot",
    },
    {
      name: "Mới nhất",
      id: "moiNhat",
    },
    {
      name: "Tin tức",
      id: "tinTuc",
    },
    {
      name: "Video",
      id: "video",
    },
  ];
  const showHeadData = (headData) => {
    return headData.map((item) => {
      return (
        <Typography
          key={item.id}
          align="center"
          variant="h3"
          color="textPrimary"
          className={classes.headDataItems}
        >
          {item.name}
        </Typography>
      );
    });
  };

  return (
    <div className={classes.root}>
      <AppBar position="static" color="transparent">
        <Toolbar>
          <Grid container alignItems="center" spacing={2}>
            <Grid item xs={1}>
              <Typography className={classes.logo}></Typography>
            </Grid>
            <Grid item container alignItems="center" xs={8}>
              {showHeadData(headData)}
            </Grid>
            <Grid
              className={classes.rightGridColor}
              container
              alignItems="center"
              justify="flex-end"
              item
              xs={3}
            >
              <AccountCircleIcon />
              <Typography align="center" variant="h4" color="textSecondary">
                Đăng nhập
              </Typography>
            </Grid>
          </Grid>
        </Toolbar>
      </AppBar>
    </div>
  );
};

export default TopBar;
